import React from 'react';
import { connect } from 'react-redux';
import {
  FlatList,
  RefreshControl,
  View,
  ActivityIndicator,
  StyleSheet,
  Platform
} from 'react-native';
import Share from 'react-native-share';
import { NoContentFound } from '../../common';
import ReviewList from './ReviewList';
import { getShoppingHistoryAction } from '../../../actions/Review';
import { LABELS } from '../../../languageConstants';

class CardReview extends React.PureComponent {
  constructor(props) {
    super(props);
    this.state = { refreshing: false };
  }

    /*onPressShareButton = async (item) => {
        const shareOptions = {
            title: 'Share file',
            url: 'data:image/png;base64,',
            failOnCancel: false,
        };

        try {
            const ShareResponse = await Share.open(shareOptions);

        } catch (error) {
            console.log('Error =>', error);
        }
    };*/

  /**
   * @method onPressShareButton
   * @description  to share the url
   */
  onPressShareButton = async (item) => {
    if (Platform.OS === 'ios') {
      const shareOptions = {
        title: 'Share Cerge app',
        subject: 'Cerge App',
        message: `${'Just had a great'} ${item.retailStore.retailer.industry} ${'experience. Thanks '}${item.retailStore.retailer.businessName}${' and Cerge for making me feel like a VIP.'}`,
        url: 'https://play.google.com/store/apps/details?id=com.cerge'
      };
      Share.open(shareOptions)
        .then(res => {
          console.log(res);
        })
        .catch(err => {
          console.log(err);
        });
    } else {
      const shareOptions = {
        title: 'Share Cerge app',
        subject: 'Cerge App',
        message: `${'Just had a great'} ${item.retailStore.retailer.industry} ${'experience. Thanks '}${item.retailStore.retailer.businessName}${' and Cerge for making me feel like a VIP.'}`,
        url: 'https://play.google.com/store/apps/details?id=in.amazon.mShop.android.shopping',
      };
      Share.open(shareOptions)
        .then(res => {
          console.log(res);
        })
        .catch(err => {
          console.log(err);
        });
    }
  };

  /**
   * @method onRefresh
   * @description to activate pull to refresh
   */
  onRefresh = () => {
    this.setState({ refreshing: true }, () => {
      this.props.getShoppingHistoryAction(
        this.props.initialrequestData,
        true,
        false,
        response => {
          this.setState({ refreshing: false });
        }
      );
    });
  };

  /**
   * @method loadMore
   * @description load more reviews with API
   */
  loadMore = () => {
    if ((this.props.totalRecords > this.props.reviewList.length) &&
      !this.props.reviewLoading) {
      const loadMoreRequestData = this.props.initialrequestData;
      loadMoreRequestData.pageIndex = this.props.pageIndex;
      this.props.getShoppingHistoryAction(
        loadMoreRequestData,
        false,
        true,
        response => {

        }
      );
    }
  };

  /**
   * @method renderTileRow
   * @description called in render list in card section
   */
  renderTileRow = ({ item }) => (
    <ReviewList
      item={item}
      index={item.shoppingHistoryID}
      screenProps={this.props.screenProps}
      onPressShareButton={() => {
        this.onPressShareButton(item);
      }}
    />
  );

  /**
   * @method renderList
   * @description used to call to render the list in flatlist by pagination
   */
  renderList = () => (
    <FlatList
      ref={(flatList) => { this._listRef = flatList; }}
      data={this.props.reviewList}
      renderItem={this.renderTileRow}
      keyExtractor={(item, index) => index.toString()}
      ListEmptyComponent={() => {
        if (!this.props.reviewLoading) {
          return (
            <NoContentFound
              customHeigth={100}
              customWidth={100}
              title={LABELS.NO_RATING}
            />
          );
        }
        return null;
      }}
      onEndReachedThreshold={0.5}
      refreshControl={
        <RefreshControl
          refreshing={this.state.refreshing}
          onRefresh={this.onRefresh}
          tintColor='#000' titleColor='#000'
          colors={['#F8D23A', '#88CE47', '#F7657C']}
        />
      }
      onEndReached={this.loadMore}
      ListFooterComponent={() => {
        if (this.props.initialrequestData.pageIndex !== 1 &&
          this.props.totalRecords > this.props.reviewList.length) {
          return (
            <View style={inlineStyle.footerLoader}>
              <ActivityIndicator size='large' color='#000000' />
            </View>
          );
        }
        return null;
      }}
    />
  );

  /**
   * @method render
   * @description to render component
   */
  render() {
    return <View style={{ margin: 5, marginBottom: 60, paddingBottom: 48 }}>{this.renderList()}</View>;
  }
}

/**
 * @method connect
 * @description connect with redux
 * @param {function} mapStateToProps
 */
const mapStateToProps = ({ review }) => {
  const { reviewLoading, initialrequestData, reviewListData } = review;
  let reviewList = [];
  let totalRecords = 0;
  let pageIndex = 1;
  if (reviewListData.reviewList) {
    reviewList = reviewListData.reviewList;
    totalRecords = reviewListData.totalRecords;
    pageIndex = reviewListData.pageIndex;
  }

  return { reviewLoading, reviewList, initialrequestData, totalRecords, pageIndex };
};

const inlineStyle = StyleSheet.create({
  footerLoader: {
    padding: 20,
    paddingBottom: 45
  }
});

export default connect(mapStateToProps, { getShoppingHistoryAction })(
  CardReview
);
